%jdbc 
SELECT keyword AS 'Phrase', score as 'Score', title AS 'Article title', name AS 'County name', date_event, ROUND(LENGTH(REGEXP_REPLACE(keyword,'[^ \t]',''))) AS 'Phrase length'
FROM article_keyword k
         JOIN article a on k.article_id = a.id
         JOIN country c on a.country_id = c.id
WHERE name LIKE '%${Country}%'
  AND date_event >= ${From=1900-01-01}
  AND date_event <= ${To=2030-01-01}
  AND score >= ${Min score=0.0}
  AND score <= ${Max score=100.0}
  AND ROUND(LENGTH(REGEXP_REPLACE(keyword,'[^ \t]',''))) ${Phrase len=>0}
